export function add23(a: number, b: number): number {
  return a + b;
}

export function subtract23(a: number, b: number): number {
  return a - b;
}

export function multiply23(a: number, b: number): number {
  return a * b;
}

export function divide23(a: number, b: number): number {
  return a / b;
}
